var population_pic = "http://game.asylamba.com/s12/public/media/resources/population.png";
var resource_pic = "http://game.asylamba.com/s12/public/media/resources/resource.png";
var science_pic = "http://game.asylamba.com/s12/public/media/resources/science.png";
var populationBool = 0;
var resourceBool = 0;
var scienceBool = 0;
var preprocessed= false;
var population = [], resource = [], science = [];

